import {Link, useParams} from 'react-router-dom'
import {useEffect, useState} from 'react'
import GlInfoItem from './GlInfoItem'


function GlInfo(props) {
	const { id } = useParams()
  
	const [galery, setGalery] = useState([])
    return (
            <div className="galery-info">
        {
            GaleryJS.map(id => (
              <GlInfoItem data={id}/>
            ))
          }
          </div>
    )
}

